// Routes/ContactUs/ContactUs.js
import React from "react";

const ContactUs = () => {
  return (
    <div className="contact-us">
      <h1>Contact Us</h1>
      <p>If you have any questions, please contact us at:</p>
      <p>Email: support@futurtainment.com</p>
      <p>Phone: +27 (0) 21 123 4567</p>
      <p>Address: 1234 Event St, Cape Town, WC 8001, South Africa</p>
    </div>
  );
};

export default ContactUs;
